import React, { useState } from 'react'
import styled from 'styled-components'

const Container = styled.div`
  background: ${props => (props.clicked ? '#F0F1F3' : '#ffffff')};
`

interface MemberBoxProps {
  clickedAccountList: Array<string>
  account_id: string
  birth_date: string
  gender: string
  name: string
  phone_number: string
}

export const MemberBox = (props: MemberBoxProps) => {
  const {
    clickedAccountList,
    account_id,
    birth_date,
    gender,
    name,
    phone_number,
  } = props
  const [clicked, setClicked] = useState(false)

  return (
    <Container>
      <div
        style={{
          background: clicked ? '#F0F1F3' : '#ffffff',
        }}
      >
        {account_id}, {birth_date}, {gender}, {name}, {phone_number}
      </div>
    </Container>
  )
}
